    //                     Home
    //                 </Link>
    //                 <Search />
    //                 <Nav />
    //                 <Route path='/' exact>
    //                     <Home />
    //                 </Route>
    //             </Route>
    //         </Switch>
    //     </Router>
        // 
    )
}

export default Header
